import React, { useRef, useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/effect-coverflow";
import "swiper/css/pagination";
import "swiper/css/navigation";
import "./styles.css";

import { EffectCoverflow, Pagination, Navigation } from "swiper";

import slide_image_1 from "./weather1.jpg";
import slide_image_2 from "./weather2.JPG";
import slide_image_3 from "/weather3.JPG";
import slide_image_4 from "/weather4.jpg";
import slide_image_5 from "/weather5.JPG";

function Animation() {
  return (
    <>
      <Swiper
        effect={"coverflow"}
        grabCursor={true}
        centeredSlides={true}
        slidesPerView={"auto"}
        coverflowEffect={{
          rotate: 50,
          stretch: 0,
          depth: 100,
          modifier: 1,
          slideShadows: true,
        }}
        pagination={true}
        modules={[EffectCoverflow, Pagination]}
        className="mySwiper"
      >
        <SwiperSlide>
          <img src="{slide_image_1}" />
        </SwiperSlide>
      </Swiper>
    </>
  );
}

export default Animation;
